import React from 'react';
import Post from '../Post/Post';
import m from './MyPosts.module.css';

const MyPosts = () => {
  let person = [
    { name: 'Sasha', id: '1' },
    { name: 'Tyom', id: '2' },
    { name: 'Viktoria', id: '3' },
    { name: 'Ann', id: '4' },
    { name: 'Ani', id: '5' },
  ];
  return (
    <div className={m.mypost}>
      <div>My posts</div>
      <form>
        <textarea rows='12px' cols='13px'></textarea>
        <button>add text</button>
        <button>remove</button>
      </form>
      <div>New Post</div>
      <div className='posts'>
        <Post msg='barior axperner' />
        <Post msg='inchka chka' />
      </div>
    </div>
  );
};

export default MyPosts;
